description:
*SPESIFIKASI TAMBAHAN*
1. Lantai bawah terdiri dari:
=> 1 Ruang tamu;
=> 2 Ruang keluarga;
=> 1 Ruang makan;
=> 2 Kamar tidur;
=> 1 Kamar mandi;
=> 1 Dapur kering;
=> 1 Dapur basah;
=> Service area yang terdiri dari: 
• 2 Kamar ART;
• 1 Kamar mandi;
• 1 Ruang pantry
2. Lantai atas terdiri dari:
=> 1 Ruang keluarga
=> 1 Kamar tidur utama yang sangat luas yang di dalamnya ada kamar mandi luas, ruang wardrobe, dan balkon
=> 2 Kamar tidur ukuran masing-masing kurang lebih 4 x 4 m²
=> 1 Kamar mandi
=> 1 Teras/balkon yang mengarah ke bagian depan rumah
3. Semi Furnished, diantaranya:
✓ Lemari-lemari besar
✓ TV berukuran besar di ruang keluarga bawah
✓ Beberapa furniture relevan lainnya

*FASILITAS*
~ Posisi rumah menghadap taman yang terawat dengan luas sekitar 2.500 m² dan dikelilingi jalan
~ Di bagian kiri dan kanan rumah bisa digunakan akses parkir dengan kapasitas minimal 30 mobil
